let dbMigrationContainer=$("div#dbMigrationContainer");let dbMigrationElem=$(dbMigrationContainer).find("#dbMigration");$(function(){$("form#dbMigrationGenerator").on("submit",function(a){a.preventDefault();a.stopPropagation();let form=this;let dbGenForm=$(form).serializeObject();getDbTableMigration(dbGenForm.table)})});function getDbTableMigration(a){xhrCall(rootPath+"/app/dbs?dbTableMigration",{table:a},{type:"get"},function(b){xhrResult(b);if(b.hasOwnProperty("status")){if(b.status===true){if(b.hasOwnProperty("migration")){let migration=b.migration;let a=b.table;migration=migration.replace(/\n/g,"<br />\n");$(dbMigrationContainer).find(".dbMigrationTableName").text(a);$(dbMigrationElem).html(migration);$(dbMigrationContainer).slideDown("slow")}}}})};